        "alias": "dailey-baby-16b0ac74055",
        "description": "These exercises are tailored to include your little bundle in a front pack carrier and with you on your mat. The program is designed to bring fitness and balance to new moms as they bond with their infants. Nursing, feeding, walking, bouncing and crying are normal activities here! Student mommies are required to bring: baby blanket and front pack carrier (and baby of course!). We'll provide a mat and everything else. NO prior barre experience is required in these classes. They are fitness based with use of resistance bands and hand held weights. Come as you are and we'll be able to chat all things modifications if needed to make class as accessible as possible. This is a series that we are holding starting June 4th - June 28th. It will be held every Tuesday and Friday from 10:15a - 11:00a. A 45 min class will be designed to help you get back to fitness with your baby in tow. Aligning, engaging, safe and effective for all levels of postpartum moms. We are excited to offer up this class format for new moms looking to bond with babe and give back to themselves at the same time. Purchase classes: You can purchase a 4 - pack of classes {https://clients.mindbodyonline.com/classic/ws?studioid=217965&stype=41&sTG=22&prodId=10735} or the whole series: 8 classes {https://clients.mindbodyonline.com/classic/ws?studioid=217965&stype=41&sTG=22&prodId=10736}. Use on any 4 or all 8 that you'd like. These classes are not transferable to our other class offerings/formats.",
