        "alias": "back-to-basics-with-mykel-salerno-steady-are-you-ready-16c59ed3c1b",
        "description": "Calling All Yogis! This workshop is designed for those seeking knowledge on how to safely and confidently approach their practice, those looking to spruce up their practice, or those who simply want to be more comfortable attending a public class, and anything else in between. Throughout this 6 week series, we will add in and break down each of the core foundational asanas (poses) and transitions used throughout a typical Vinyasa style flow class. Focusing on:- Breath to Movement- Common misalignments- Strengthening- Use of props to support each unique body type- Modifications- Benefits of each asana Join Mykel every other Sunday • 2:00pm - 4:00 PMJuly 7th & 21stAugust 4th & 18thSeptember 1st & 15th 6 Week Overview:Week 1, July 7th: Let’s Break it Down Now, Y'all- Surya Namaskar A (Sun Salutation A) Week 2, July 21st: Work That Body- Week 1 review- Anjaneyasana (Crescent Lunge) Week 3, August 4th: Strong Warrior- Week 1 through 2 review- Virabhadrasana I & II (Warrior I & II) Week 4, August 18th: Steady, are you Ready?- Week 1 through 3 review- Balancing Asanas Week 5, September 1st: Wringing it Out- Week 1 through 4 review- Twisting Asanas Week 6, September 15th: Let’s Flow!- Week 1 through 5 review- Flowing through our asanas in sequence Autorenew members: $35 per session, $175 for series Non-autorenew: $40 per session, $180 for series",
